import React from 'react';

import './Table.scss';
import { Modal } from 'react-bootstrap';
import Pagination from 'react-js-pagination';
export default props => {
  const {heade, body} = props;
  return (
    <div className="custom-table border table-responsive ">
      <table className="table ">
        <thead>
          {heade}
        </thead>
        <tbody>
          {body}
        </tbody>
      </table>
      <Pagination />
    </div>
  );
};
